import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-047d3f3ec858d",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/media/itsd/ITSD/Projects/wilfried/docs/README.md").then(comp => {
        Vue.component("v-047d3f3ec858d", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-b705d7f6af496",
    path: "/about/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/media/itsd/ITSD/Projects/wilfried/docs/about/README.md").then(comp => {
        Vue.component("v-b705d7f6af496", comp.default)
        next()
      })
    }
  },
  {
    path: "/about/index.html",
    redirect: "/about/"
  },
  {
    name: "v-8ed82640b602f",
    path: "/guides/getting-started.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/media/itsd/ITSD/Projects/wilfried/docs/guides/getting-started.md").then(comp => {
        Vue.component("v-8ed82640b602f", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
